import React from 'react'

import logo from '../../imgs/horse.png'

import {HeaderBody, HeaderImg, } from './syled'

function Header() {
  return (
    <HeaderBody>
      <HeaderImg src={ logo } alt="Horse logo" />
      <Title>O passeio do cavalo</Title>
    </HeaderBody>
  )
}

export default Header;
